import React from "react";
import { AppBar, Toolbar, CssBaseline, makeStyles } from "@material-ui/core";
import { Link } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  navlinks: {
    marginTop: theme.spacing(2),
    marginBottom: theme.spacing(2),
    display: "flex",
    flexWrap: "wrap",
  },
  link: {
    textDecoration: "none",
    color: "white",
    fontSize: "25px",
    marginRight: "3vw",
    "&:hover": {
      color: "yellow",
      fontWeight: "700",
    },
  },
}));

function NavBar() {
  const classes = useStyles();

  return (
    <AppBar position="static" style={{ backgroundColor: "#557452" }}>
      <CssBaseline />
      <Toolbar>
        <div className={classes.navlinks}>
          <h1 style={{ width: "1px", height: "1px", overflow: "hidden" }}>
            Welcome to Portland
          </h1>
          {/* <Link to="/" className={classes.link} style={{ display: "none" }}>
            /
          </Link> */}
          <Link to="/Home" className={classes.link}>
            Home
          </Link>
          <Link to="/AboutPortland" className={classes.link}>
            About Portland
          </Link>
          <Link to="/Things" className={classes.link}>
            Things to do
          </Link>
          <Link to="/About" className={classes.link}>
            About Us
          </Link>
        </div>
      </Toolbar>
    </AppBar>
  );
}

export default NavBar;
